import React from "react";
import { Card } from "react-bootstrap";

const SensorEventForm = () => {
  return (
    <div className="row">
      <Card border="info" style={{ width: "18rem" }}>
        <Card.Header>Header</Card.Header>
        <Card.Body>
          <form>
            <input
              type="text"
              name="name"
              placeholder="event"
              className="form-control"
            />
          </form>
        </Card.Body>
      </Card>
    </div>
  );
};

export default SensorEventForm;
